import { Typewriter } from 'react-simple-typewriter'


function Home() {
    return(
      <div className="home"> 
        <div className="homeBox">
          <h1>
          <Typewriter  
           textStyle={{
            fontFamily: 'Red Hat Display',
            color: 'red',
            fontWeight: 500,
            fontSize: '1.5em',
          }}
            cursor

            cursorStyle='_'
            typeSpeed={70}
            deleteSpeed={50}
            delaySpeed={1000}

            words={['Welcome to Give Good'] }
            />
          </h1>



        </div>
      </div>
  );

}

export default Home;
